import React, { useState } from "react";
import styles from "./Header.module.scss";
import logo from "../../../../shared/assets/icons/logo.png";
import telegram from "../../../../shared/assets/icons/telegram.png";
import github from "../../../../shared/assets/icons/github.png";
import instagram from "../../../../shared/assets/icons/instagram.png";


const Header = () => {
  
  return (
    <div className={styles.header}>
      <div className={styles.logo}>
       <img className={styles.logo_img} src={logo} alt="" />
      </div>
      <div className={styles.social}>
        <a href="">
          <img  className={styles.social_logo} src={telegram} alt="" />
        </a>
        <a href="">
          <img className={styles.social_logo} src={github} alt="" />
        </a>
        <a href="">
          <img className={styles.social_logo} src={instagram} alt="" />
        </a>
      </div>
    </div>
  );
};

export default Header;
